(window.webpackJsonp=window.webpackJsonp||[]).push([[89],{86:function(e){e.exports=JSON.parse('{"id":"self-introduction","title":"Self Introduction","description":"Interviewers want to work with candidates they like. Leave a good/deep impression and it will increase your chances of success. Most of us are not strangers to self introductions as we meet new people now and then and have to introduce ourselves every once in a while. However, self introductions in interviews are slightly different from real life - you need to tweak it to your advantage - tailor the self introduction to the role and company you are applying for! Your self introduction evolves as you grow and are at a different stage of your life.","source":"@site/../contents/self-introduction.md","permalink":"/tech-interview-handbook/self-introduction","sidebar":"docs","next":{"title":"Overview","permalink":"/tech-interview-handbook/coding-round-overview"},"previous":{"title":"Interview Formats","permalink":"/tech-interview-handbook/interview-formats"},"lastUpdatedBy":"Yangshun Tay","lastUpdatedAt":1568501221}')}}]);